SELECT LINEITEM.L_LINENUMBER, ORDERS.O_CLERK, SUPPLIER.S_SUPPKEY, NATION.N_NAME, PARTSUPP.PS_SUPPKEY, MAX(NATION.N_NATIONKEY) FROM NATION, SUPPLIER, PARTSUPP, LINEITEM, ORDERS GROUP BY LINEITEM.L_LINENUMBER, ORDERS.O_CLERK, SUPPLIER.S_SUPPKEY, NATION.N_NAME, PARTSUPP.PS_SUPPKEY HAVING MAX(NATION.N_NATIONKEY) > PARTSUPP;
